package com.ruoyi.system.domain;import com.ruoyi.common.core.domain.BaseEntity;import java.util.Date;public class Complain extends BaseEntity {    private Integer id;    private String name;    private Date create_time;    private String description;    private Date end_time;    private String picture;    private int type;    private int status;    public Integer getId() {        return id;    }    public void setId(Integer id) {        this.id = id;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public Date getCreate_time() {        return create_time;    }    public void setCreate_time(Date create_time) {        this.create_time = create_time;    }    public String getDescription() {        return description;    }    public void setDescription(String description) {        this.description = description;    }    public Date getEnd_time() {        return end_time;    }    public void setEnd_time(Date end_time) {        this.end_time = end_time;    }    public String getPicture() {        return picture;    }    public void setPicture(String picture) {        this.picture = picture;    }    public int getType() {        return type;    }    public void setType(int type) {        this.type = type;    }    public int getStatus() {        return status;    }    public void setStatus(int status) {        this.status = status;    }}